import React from 'react';
import './App.css';

import Main from './necessary/Main';


function App() {
  return (
    <body>
     <header>
     <li><a href="">메인으로</a></li>
     <li> |</li>
     <li><a href="">정책 페이지</a></li>
     </header>
    <section>
    <Main/>
    </section>
    </body>
  );
}

export default App;
